[code]{   LevExidus AutoMiner        ]
[       By Jvwarrior           ]
[______________________________]
[      Instructions:           ]
[1. First find the ore you     ]
[   would like to mine.        ]
[   Then click on the color    ]
[   picker on your top bar.    ]
[   Use the color picker to get]
[   your ore color.            ]
[                              ]
[2. When you have the ore color]
[   copy and paste it into     ]
[   orecolor1 using ctrl+alt+c ]
[   to copy.                   ]
[                              ]
[3. Specifie the RS window     ]
[   using the Crosshairs on    ]
[   your top bar. Drag them to ]
[   the runescape screen.      ]
[                              ]
[4. Start the script. Watch as ]
[   SCAR automatically mines   ]
[   your ore for you.          ]
[      HAPPY CHEATING!         ]
[______________________________}
program Autominer;
{.Include SRL/SRL.Scar}

{!*================EDIT ORE COLOR!=================*!}
const
  orecolor1 = 2371663;
{!*=================OK YOUR GOOD===================*!}
{!*==============NOW EDIT YOUR PLAYER==============*!}

procedure DeclarePlayers;
begin
  HowManyPlayers := 1;
  NumberOfPlayers(HowManyPlayers);
  CurrentPlayer := 0;

  Players[0].Name := 'Username'; //place your username here
  Players[0].Pass := 'Password'; //place your password here
  Players[0].Nick := 'Nickname'; //3 - 4 letters of YOUR username, example: sern
  Players[0].Active := True;
end;
{!*================NO TOUCHING!====================*!}
var
  x, y: Integer;

procedure LoadBMP;
begin
  ModBMP := BitmapFromString(13, 11, 'z78DA3330A037707274723' +
    '430307732774215C71481005743574354BDB84C43560911C1540F' +
    '51838B84A8C71427CF345C24754D839833924D23CF4C5CE6500B0' +
    '000AB69B141');
end;

procedure Cred;
begin
  Writeln('LevExidus AutoMiner')
    Writeln('By Jvwarrior')
    Writeln('Enjoy The Script!')
end;

procedure StartMe;
begin
  Writeln('Starting')
    Writeln('J')
    Wait(200)
    Writeln('JV')
    Wait(200)
    Writeln('JVW')
    Wait(200)
    Writeln('JVWA')
    Wait(200)
    Writeln('JVWAR')
    Wait(200)
    Writeln('JVWARR')
    Wait(200)
    Writeln('JVWARRI')
    Wait(200)
    Writeln('JVWARRIO')
    Wait(200)
    Writeln('JVWARRIOR')
    Wait(200)
    Writeln('OWNZ THIS SCRIPT!')
end;

procedure Mining;
begin
  repeat
    if (findcolorspiraltolerance(x, y, orecolor1, msx1, msy1, msx2, msy2, 25)) then
      mouse(x, y, 3, 3, true);
    wait(2000);
    case Random(10) of
      6: typesend('Mining lvls?');
    end;
  until (InvFull);
  if (InvFull) then DropToPosition(2, 28);
end;

procedure DisableChats;
begin
  if (not (LoggedIn)) then
    Exit;
  SetChat('off', 1);
  SetChat('friends', 2);
  SetChat('on', 3);
  SetChat('off', 4);
end;

procedure Login;
begin
  if (not (LoggedIn)) then
    LoginPlayer;
end;

procedure ScanForMod;
begin
  if (findbitmap(ModBMP, x, y)) then
  begin
    writeln('OMG Mod!');
    TerminateScript;
  end;
end;

function FindFastRandoms: Boolean;
var
  i: Integer;
begin
  for i := 1 to 10 do
  begin
    case I of
      1: if FindDead then
          Result := True;
      2: if FindMod then
          Result := True;
      3: if FindMime then
          Result := True;
      4: if FindMaze then
          Result := True;
      5: if FindQuiz then
          Result := True;
      6: if FindDemon then
          Result := True;
      7: begin
          if NoGameTab then
          begin
            Result := True;
            Players[CurrentPlayer].loc := 'No GameTab';
            Logout;
            Exit;
          end;
        end;
      8: begin
          if InBlack then
          begin
            Result := True;
            Players[CurrentPlayer].loc := 'InBlack';
            Logout;
            Exit;
          end;
        end;
      9: RC;
      10: Respond;
    end;
    wait(1);
  end;
end;

procedure FindTheRandoms;
begin
  FindTalk;
  FindFastRandoms;
  FindNormalRandoms;
  FindLamp('Mining');
  SolvePinball;
  if (FindFight) then
  begin
    MakeCompass('N');
    RunTo('N', True);
    Wait(7000 + Random(3000));
    RunBack;
  end;
end;

procedure ABan;
begin
  if (not (LoggedIn)) then
    Exit;
  case Random(8) of
    0: RandomRClick;
    1: HoverSkill('Mining', False);
    2: RandomMovement;
    3: BoredHuman;
    4: PickUpMouse;
    5: AlmostLogout;
    6: begin
        GameTab(1 + Random(12));
        wait(2000 + Random(1000));
        GameTab(4);
      end;
  end;
end;

begin
  SetupSRL;
  ActivateClient;
  DeclarePlayers;
  NickNameBMP := CreateBitmapMaskFromText(Players[CurrentPlayer].Nick, UpChars);
  Login;
  DisableChats;
  repeat
    LoadBMP;
    FindFastRandoms;
    FindTheRandoms;
    ScanForMod;
    ABan;
    Mining;
  until (IsFKeyDown(10));
end.[/code]

